import React, { Component } from 'react';
import { Media, Container, Col, Row, Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap';
import Linkify from 'react-linkify';

class App extends Component {
  render() {
    return (
      <Container>
        <Col sm={{ size: 'auto', offset: 4 }}>
          <form method='post' action='#' class='loginForm'>
            <Col sm={{ size: 'auto', offset: 4 }}>
            <img class="profileImg" width="100px" src={'https://bit.ly/2TpS6AW'} style={{marginBottom: '30px', borderRadius: '200px'}} className="img-responsive"/>
            </Col>

            <FormGroup>
              <Input autoFocus type="email" name="email" id="exampleEmail" placeholder="Email" />
            </FormGroup>

            <FormGroup>
              <Input type="password" name="password" id="examplePassword" placeholder="Password" />
            </FormGroup>

            <FormGroup>
              <Button color="red" size="me" block>Login</Button>
            </FormGroup>

            <FormGroup>
              <Linkify><a style={{float: 'left'}} href='#'>Create account</a></Linkify>
              <Linkify><a style={{float: 'right'}} href='#'>Forgot password</a></Linkify>
            </FormGroup>
          </form>
        </Col>
      </Container>
    );
  }
}

export default App;
